import styled from "styled-components";

const List = () => {
  return (
    <Wrap>
        <ul>
            <li>ddd</li>
            <li>ddd</li>
            <li>ddd</li>
            <li>ddd</li>
            <li>ddd</li>
            <li>ddd</li>
        </ul>
    </Wrap>
  )}

  
export default List;

const Wrap = styled.main`
  width: 100%;
  height: 100%;
  
  
  ul{
    width: 500px;
    height: 100%;
    display: flex;
    flex-wrap: wrap;
    overflow-y: hidden;
  }

  li{
    width: 100%;
    height: 100%;
  }
`;
